import React from "react";

const SignUp = () => {
  const submit = () => {
    console.log("On Submit called");
  };
  return (
    <div className="container">
      <div className="row">
        <form onSubmit={submit}>
          <div className="mb-3">
            <label htmlFor="name" className="form-label">
              Name
            </label>
          </div>
        </form>
      </div>
    </div>
  );
};

export default SignUp;
